import React from "react";
import { styled } from "styled-components";

const HomeContainer = styled.div`
	background-color: rgb(213, 105, 234);
	width: 100vw;
	height: 100vh;
`;

function Home() {
	return <HomeContainer></HomeContainer>;
}

export default Home;
